function Navbar({ parentSections }) {
  return (
    <nav className="w-64 h-screen fixed bg-gray-900 text-gray-300 border-r border-gray-700">
      <div className="p-6">
        <h2 className="text-3xl font-bold mb-6 text-gray-100 text-center">Image Filters</h2>
        <ul className="space-y-6">
          {parentSections.map((parent) => (
            <li key={parent.id} className="group">
              <a
                href={`#${parent.id}`}
                className="block text-xl py-2 transition-all duration-300 hover:text-white hover:underline"
              >
                {parent.title}
              </a>
              <ul className="pl-4 mt-2 space-y-3">
                {parent.sections.map((section) => (
                  <li key={section.id}>
                    <a
                      href={`#${section.id}`}
                      className="block text-lg text-gray-400 hover:text-white hover:underline transition-all duration-300"
                    >
                      {section.title}
                    </a>
                  </li>
                ))}
              </ul>
            </li>
          ))}
        </ul>
      </div>
    </nav>
  );
}

export default Navbar;
